function Projects() {
	const BDD = Bank;

	return (
		<div className="fondProjects">
			<Header />
			<div>
				<div className="titleGlich">
					<h1 className="intro_text">
						<span aria-hidden="true">Voici une liste de mes projects :</span>
						Voici une liste de mes projects :
						<span aria-hidden="true">Voici une liste de mes projects :</span>
					</h1>
				</div>

				<div className="cardHexas">
					{BDD.map((element, index) => (
						<div className="cardHexa" key={index}>
							<Card infos={element} />
						</div>
					))}
				</div>
			</div>
			<Footer />
		</div>
	);
}

export default Projects;
